import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View , Image, SafeAreaView} from 'react-native';

export default function App() {
 const forPress = () => console.log('Text Pressed');

  return (
    <SafeAreaView style={styles.container}>
      <Text numberOfLines = {3} onPress={forPress} >Welcome to my IA project</Text>
      <Image source={{
       width:200,
       height:300, 

       uri: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQrCaDqsDX_jDcsuDKHy9g5YbE-Ck71LJI1cQ&usqp=CAU"}}/> 
      <StatusBar style="auto" />
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'dodgerblue',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
